import './App.css';
import Home from './pages/Home';
import React from 'react';
import Navbar from './components/Navbar';

function App() {
return (
<div className="flex min-h-screen">
    <div className="w-64 bg-gray-100 border-r">
    <Navbar />
    </div>
    <main className="flex-grow p-6">
    <Home />
    </main>
</div>
);
}

export default App;
